import './App.css';
import { Route, Routes } from "react-router-dom";
import Portfolio from "./Views/Portfolio/Portfolio";

function App() {
  return (
    <div className="App">
       <Routes>
        <Route path="/" element={<Portfolio />} />
       </Routes>
    </div>
  );
}

export default App;
